import React, { Component } from "react";
import { Container} from "semantic-ui-react";
import { withTranslation } from "react-i18next";
import i18n from "i18next";
import Footer from "../LandingPage/Footer";
import { NavBar } from "./tremsConditionsNavbar";
import "./style.css";
import DesktopBreakpoint from "../../components/Responsive_utillities/desktop_breakPoint";
import PhoneBreakpoint from "../../components/Responsive_utillities/phone_breakPoint";
import PrivacyPolicyMain from "./PrivacyPolicyMain";
import PrivacyPolicyPageAR from "./PrivacyPolicyPageAR";

class PrivacyPolicyPage extends Component {
  componentDidMount() {
    document.body.dir = i18n.dir();
  }

  render() {
    const { t } = this.props;
    const language = localStorage.getItem("i18nextLng");
    return (
      <Container fluid>
        <DesktopBreakpoint>
          <NavBar title={t("landingPage:privacyPolicynavbarTitle")} 
            subtitle={t("landingPage:privacyPolicynavbarSubTitle")}/>
          {language !== "ar" ?   <PrivacyPolicyMain/> : <PrivacyPolicyPageAR/>}
        
          <Footer />
        </DesktopBreakpoint>
        <PhoneBreakpoint name="phone">
        <NavBar title={t("landingPage:privacyPolicynavbarTitle")} 
         subtitle={t("landingPage:privacyPolicynavbarSubTitle")}/>
        {language !== "ar"?   <PrivacyPolicyMain/> : <PrivacyPolicyPageAR/>}
          <Footer />
        </PhoneBreakpoint>
      </Container>
    );
  }
}
export default withTranslation("landingPage")(PrivacyPolicyPage);
